A detective and a psychiatrist team up to stop a sadistic serial killer with a grotesque torture fetish. Ghost (Daniel Baldwin) is a madman with a basement full of terrified women. Police Detective Balasco and psychiatrist Dr, Metcalfe are determined to stop Ghost's wicked reign of terror, but meanwhile his latest crop of victims face a grim fate - unless they can somehow summon the courage to team up, and overpower their twisted tormentor.          

